using Components;using System;using MessagePack;using HECSFramework.Serialize;using Commands;namespace HECSFramework.Core{	[MessagePackObject, Serializable]	public struct CurrentSpeedComponentResolver : IResolver<CurrentSpeedComponent>, IResolver<CurrentSpeedComponentResolver,CurrentSpeedComponent>, IData	{		public CurrentSpeedComponentResolver In(ref CurrentSpeedComponent currentspeedcomponent)		{			return this;		}		public void Out(ref IEntity entity)		{			var local = entity.GetCurrentSpeedComponent();			Out(ref local);		}		public void Out(ref CurrentSpeedComponent currentspeedcomponent)		{		}	}}